import React from 'react';

const Collaboration = () => {
    return (
        <div>
            <h1>Collaboration Opportunities</h1>
            <p>We are always looking for new collaboration opportunities. If you are interested in partnering with us, please reach out!</p>
        </div>
    );
};

export default Collaboration;
